import React, { useEffect } from "react";

function Animals() {

    useEffect(() => {
        fetch("/animals")
        .then((res) => res.json())
        .then((res) => console.log(res))
    }, [])

    return (
        <div>

            <h1>Animals!</h1>
        </div>
    )
}

export default Animals;
